// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;
import './ERC20.sol';

contract Pool{
    ERC20 MyToken;
    ERC20 MyUSDT;
    mapping (address => uint) public ledger;  //记录用户存了多少MyToken
    mapping (address => uint) public distributed;  //记录用户获得了多少流动性收益
    mapping (address => bool) exist;
    address[] addresses;
    uint MyTokenAmount;
    uint lastHeight;
    constructor(address addr1,address addr2){
        MyToken = ERC20(addr1);
        MyUSDT = ERC20(addr2);
    }

    event Deposit(address indexed sender, uint amount,uint balance);
    event Withdraw(address indexed sender, uint amount,uint balance);
    event Claim(address indexed sender,uint amount);
    
    function distribute() internal{
        uint amount = block.number-lastHeight * 100;
        for(uint i = 0 ; i < addresses.length ; i++){
            distributed[msg.sender] += amount/MyTokenAmount*ledger[addresses[i]];
        }
        lastHeight = block.number;
    }

    function deposit(uint amount) external{
        //先判断用户是否存在
        if(!exist[msg.sender]){
            addresses.push(msg.sender);
            exist[msg.sender] = true;
        }

        distribute();

        require(MyToken.allowance(msg.sender,address(this))>=amount,"You have not approve enough tokens.");
        MyToken.transferFrom(msg.sender,address(this),amount);
        ledger[msg.sender] += amount;
        MyTokenAmount += amount;
        emit Deposit(msg.sender,amount,ledger[msg.sender]);
    }

    function withdraw(uint amount) external{
        require(ledger[msg.sender] >= amount,"You do not have enough tokens.");
        distribute();

        MyToken.transfer(msg.sender,amount);
        ledger[msg.sender] -= amount;
        emit Withdraw(msg.sender,amount,ledger[msg.sender]);
    }

    function claim() external{
        require(distributed[msg.sender] > 0,"You do not have any liquidity mining revenue.");
        distribute();

        MyUSDT.transfer(msg.sender,distributed[msg.sender]);
        distributed[msg.sender] = 0;
        emit Claim(msg.sender,distributed[msg.sender]);
    }
}
